    public function index()
    {
            $items = DB::table('iteminfos')->where('status', '=', 1)->get();
            $suppliers = DB::table('supplierinfos')->get();
            $payment_types = DB::table('paymenttypes')->where('status', '=', 1)->get();
                           $payment_type=array();
